import React, { Component } from "react";

import AboutAstar from "./AboutAstar";

export default class AboutAlgorithm extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.close = this.close.bind(this);
  }

  componentDidMount() {}

  close() {
    const newPageIndex = 0;
    this.setState({ pageIndex: newPageIndex });
    this.props.closeTutorial();
  }

  render() {
    var { algorithm } = this.props;

    switch (algorithm) {
      case "A*":
        this.algorithmForm = <AboutAstar close={this.close} />;
        break;
      default:
        this.algorithmForm = null;
    }
    return this.algorithmForm;
  }
}
